import React from 'react';

function Form(props) {
  return (
    <div>
      <p>ID: {props.value.id}</p>
      <p>Login: {props.value.login}</p>
      <p>Link profile: {props.value.url}</p>
      <p>Created At: {props.value.updated_at}</p>
    </div>
  );
}

export default Form;
